INSERT INTO `action_log` (`ID`, `account_ID`, `api_controller_ID`, `access_number_ID`, `detail`, `datetime`) VALUES
(10035, 55, 4, 0, '{"ID":"1","updated_data":{"detail":"<p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Do you know how much garbage you produce each week?<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Better question: Are you prepared to see it firsthand, getting up close and personal by lying amid a week\\u2019s worth of your trash?<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Amazingly, some people were, and photographer Gregg Segal captured the results in his startling series&nbsp;<a title=\\"7 Days of Garbage\\" href=\\"http:\\/\\/fence.photovillenyc.org\\/f-2014\\/atlanta\\/home\\/gregg-segal\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">\\u201c7 Days of Garbage.\\u201d<\\/a>&nbsp;You can take a look at what a typical week of trash looks like for different households in&nbsp;<a title=\\"Mesmerizing Photos of People Lying in a Week\\u2019s Worth of Their Trash \\" href=\\"http:\\/\\/www.slate.com\\/blogs\\/behold\\/2014\\/07\\/08\\/gregg_segal_photographs_people_with_a_week_s_worth_of_their_trash_in_his.html\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">this recent article on Slate<\\/a>.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">We see two morals in this pungent story:<\\/p><div style=\\"margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);\\"><center style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><div id=\\"googmob\\" style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><\\/div><\\/center><\\/div><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">1. Americans produce a scary amount of trash.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">2. Some of that trash could be put to better use making them cold, hard cash.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">We took a closer look at these unpleasant but powerful photos to identify some ways these people could be turning their trash into cash \\u2014 and you could be, too.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">Recycling<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Bottles and cans<\\/span><\\/p><div style=\\"margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);\\"><center style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><div id=\\"placement_197470_0\\" style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><\\/div><\\/center><\\/div><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Depending on your state\\u2019s return laws, you can save them up and<a title=\\"How I Made $1,500 Collecting Soda Cans at Work\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/collecting-cans\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">return them<\\/a>&nbsp;to your local grocery store or recycling center for profit.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Wine bottles and corks<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>They\\u2019re actually hot material for DIY projects, and arts and crafters will pay for them on eBay. Just wash them off,&nbsp;<a title=\\"Make Money Recycling Wine Corks\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/make-money-recycling-wine-corks\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">list them<\\/a>&nbsp;and profit!<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Metal bits and pieces<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>You don\\u2019t have to have a big item like a beat-up car to cash in on<a title=\\"Scrap Your Way to Hundreds\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/scrap-your-way-to-hundreds\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">selling scrap metal<\\/a>. Everything from old door locks to copper wiring can fetch a decent price if you collect enough of it.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);