fed-animals-for-extra-cash\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">sell them on eBay<\\/a>. Collectors, gift-givers and people looking to recapture their childhood are all willing to pay to take them off your hands.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">For Bonus Points<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Once you\\u2019ve learned how to max out the profit with your own trash, why not take it up a notch and starting&nbsp;<a title=\\"Why You Should See Dollar Signs When Your Neighbor Puts Junk On the Curb\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/i-found-50-in-the-garbage\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">selling other people\\u2019s junk<\\/a>? Dumpster-diving and curbside-trolling aren\\u2019t just for recent grads hoping to score a futon; they can also become a nice side business if you\\u2019re willing to put in a little work. You can also snag&nbsp;<a title=\\"How to Make Money Reselling Craigslist Freebies\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/how-to-make-money-reselling-craigslist-freebies\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">free items on Craigslist<\\/a>&nbsp;and resell them for a profit.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Look at you, saving the planet and making money at the same time!<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Your Turn: These are just a few ideas for making money from commonly thrown-away items. What other ways can you think of to turn your trash into cash?<\\/span><\\/p>"}}', 1456270679),
(10036, 55, 4, 0, '{"ID":"1","updated_data":{"detail":"<p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Do you know how much garbage you produce each week?<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Better question: Are you prepared to see it firsthand, getting up close and personal by lying amid a week\\u2019s worth of your trash?<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Amazingly, some people were, and photographer Gregg Segal captured the results in his startling series&nbsp;<a title=\\"7 Days of Garbage\\" href=\\"http:\\/\\/fence.photovillenyc.org\\/f-2014\\/atlanta\\/home\\/gregg-segal\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">\\u201c7 Days of Garbage.\\u201d<\\/a>&nbsp;You can take a look at what a typical week of trash looks like for different households in&nbsp;<a title=\\"Mesmerizing Photos of People Lying in a Week\\u2019s Worth of Their Trash \\" href=\\"http:\\/\\/www.slate.com\\/blogs\\/behold\\/2014\\/07\\/08\\/gregg_segal_photographs_people_with_a_week_s_worth_of_their_trash_in_his.html\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">this recent article on Slate<\\/a>.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">We see two morals in this pungent story:<\\/p><div style=\\"margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);\\"><center style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><div id=\\"googmob\\" style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><\\/div><\\/center><\\/div><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">1. Americans produce a scary amount of trash.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">2. Some of that trash could be put to better use making them cold, hard cash.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">We took a closer look at these unpleasant but powerful photos to identify some ways these people could be turning their trash into cash \\u2014 and you could be, too.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">Recycling<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Bottles and cans<\\/span><\\/p><div style=\\"margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);\\"><center style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><div id=\\"placement_197470_0\\" style=\\"margin: 0px; padding: 0px; max-height: 1e+06px;\\"><\\/div><\\/center><\\/div><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Depending on your state\\u2019s return laws, you can save them up and<a title=\\"How I Made $1,500 Collecting Soda Cans at Work\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/collecting-cans\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">return them<\\/a>&nbsp;to your local grocery store or recycling center for profit.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Wine bottles and corks<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>They\\u2019re actually hot material for DIY projects, and arts and crafters will pay for them on eBay. Just wash them off,&nbsp;<a title=\\"Make Money Recycling Wine Corks\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/make-money-recycling-wine-corks\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">list them<\\/a>&nbsp;and profit!<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Metal bits and pieces<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>You don\\u2019t have to have a big item like a beat-up car to cash in on<a title=\\"Scrap Your Way to Hundreds\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/scrap-your-way-to-hundreds\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">selling scrap metal<\\/a>. Everything from old door locks to copper wiring can fetch a decent price if you collect enough of it.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: All other miscellaneous recyclable material<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use #1:&nbsp;<\\/span>Get paid for having your city haul it away!&nbsp;<a title=\\"Recyclebank\\" href=\\"https:\\/\\/www.recyclebank.com\\/curbside\\/details\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">Recyclebank<\\/a>works with waste haulers in many communities to track how much recycling they collect from your curb. You earn points for each haul, which can be converted into rewards like magazine subscriptions and shopping discounts. (<a href=\\"http:\\/\\/ctt.ec\\/9ho1z\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">Like this idea? Click to tweet it<\\/a>!)<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use #2:<\\/span>&nbsp;If you prefer to give back,&nbsp;<a title=\\"Terracycle\\" href=\\"http:\\/\\/www.terracycle.com\\/en-US\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">Terracycle<\\/a>&nbsp;will send you a prepaid box to mail your trash in to them. Every box you send in earns you points that can be redeemed for charitable gifts or donations to the nonprofit or school of your choice.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">Reusing<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Unused fruit<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use&nbsp;<\\/span>Not sure you\\u2019ll be able to eat all that fruit before it goes bad? Make it into jam or preserves and sell them at your local&nbsp;<a title=\\"Dream of Selling Jam or Produce at a Farmers Market? Here\\u2019s Your Guide\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/dream-selling-jam-produce-farmers-market-heres-guide\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">farmers market<\\/a>.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Soggy coffee grounds<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Used coffee grounds actually make great compost, as two business students found out and leveraged into their&nbsp;<a title=\\"Back to the Roots\\" href=\\"https:\\/\\/www.backtotheroots.com\\/about-us\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">Back to the Roots<\\/a>urban mushroom growing kits.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Food scraps<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Create a compost heap in your yard and use it to fertilize a kitchen garden to&nbsp;<a title=\\"Choose the Best, Money-Saving Plants for Your Vegetable Garden\\" href=\\"http:\\/\\/lifehacker.com\\/choose-the-best-money-saving-plants-for-your-vegetable-510676441\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">reduce your grocery bills<\\/a>.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Random fabric scraps and other odds and ends that can\\u2019t be recycled<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Get crafty! You can make everything from purses to picture frames with a little artistic creativity and sell them on sites like Etsy.&nbsp;<a title=\\"She Turns Trash Into Cash\\" href=\\"http:\\/\\/www.more.com\\/reinvention-money\\/second-acts\\/she-turns-trash-into-cash\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">This woman in Turkey<\\/a>&nbsp;built a whole business out of turning used packaging like candy wrappers and canned-food labels into clutches and handbags.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">Selling<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Food packaging<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Cut out those&nbsp;<a title=\\"Boxtops For Education\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/blog-posting-7\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">Boxtops for Education<\\/a>&nbsp;and sell them on eBay \\u2014 you may not have any use for them, but other people will pay for them.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Old baby toys\\/household items\\/etc.<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:<\\/span>&nbsp;Just because you\\u2019re no longer using something, that doesn\\u2019t mean someone else won\\u2019t be able to get many more years out of it. Rather than trashing your gently used items, consider selling them at a&nbsp;<a title=\\"A Fun and Low-Cost Business: Selling at Flea Markets\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/selling-at-flea-markets\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">flea market<\\/a>, garage sale or on Craigslist to put some extra cash in your pocket (and keep one more item out of a landfill).<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Defunct phones<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Upgraded to something cooler? Don\\u2019t junk your old device;&nbsp;<a title=\\"How to Sell Your Old Phone for the Most Amount of Cash\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/how-to-sell-your-old-phone-for-the-most-amount-of-cash\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">you can sell it<\\/a>&nbsp;for profit.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Item: Used stuffed animals<\\/span><\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Better use:&nbsp;<\\/span>Give them a clean-up and&nbsp;<a title=\\"How to Sell Used Stuffed Animals for Extra Cash\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/how-to-sell-used-stuffed-animals-for-extra-cash\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">sell them on eBay<\\/a>. Collectors, gift-givers and people looking to recapture their childhood are all willing to pay to take them off your hands.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">For Bonus Points<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Once you\\u2019ve learned how to max out the profit with your own trash, why not take it up a notch and starting&nbsp;<a title=\\"Why You Should See Dollar Signs When Your Neighbor Puts Junk On the Curb\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/i-found-50-in-the-garbage\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">selling other people\\u2019s junk<\\/a>? Dumpster-diving and curbside-trolling aren\\u2019t just for recent grads hoping to score a futon; they can also become a nice side business if you\\u2019re willing to put in a little work. You can also snag&nbsp;<a title=\\"How to Make Money Reselling Craigslist Freebies\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/how-to-make-money-reselling-craigslist-freebies\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">free items on Craigslist<\\/a>&nbsp;and resell them for a profit.<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Look at you, saving the planet and making money at the same time!<\\/p><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\"><span style=\\"font-weight: 700; margin: 0px; padding: 0px; max-height: 1e+06px;\\">Your Turn: These are just a few ideas for making money from commonly thrown-away items. What other ways can you think of to turn your trash into cash?<\\/span><\\/p>"}}', 1456270907),
