fed-animals-for-extra-cash\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">sell them on eBay<\\/a>. Collectors, gift-givers and people looking to recapture their childhood are all willing to pay to take them off your hands.<\\/p><h3 style=\\"font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); margin: 28px 0px 14px; font-size: 1.15em; max-height: 1e+06px; padding: 0px !important; background-color: rgb(255, 255, 255) !important;\\">For Bonus Points<\\/h3><p style=\\"margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);\\">Once you\\u2019ve learned how to max out the profit with your own trash, why not take it up a notch and starting&nbsp;<a title=\\"Why You Should See Dollar Signs When Your Neighbor Puts Junk On the Curb\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/i-found-50-in-the-garbage\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">selling other people\\u2019s junk<\\/a>? Dumpster-diving and curbside-trolling aren\\u2019t just for recent grads hoping to score a futon; they can also become a nice side business if you\\u2019re willing to put in a little work. You can also snag&nbsp;<a title=\\"How to Make Money Reselling Craigslist Freebies\\" href=\\"http:\\/\\/www.thepennyhoarder.com\\/how-to-make-money-reselling-craigslist-freebies\\/\\" target=\\"_blank\\" style=\\"color: rgb(168, 100, 168); text-decoration: underline; margin: 0px; padding: 0px; max-height: 1e+06px; outline: 0px; font-weight: bold; font-size: 22px;\\">free items on Craigslist<\\/a>&nbsp;and resell them for a profit.<\\/p