(10937, 82, 4, 0, '{"ID":"2","updated_data":{"detail":"<h1 style=\\"text-align: center;\\"><font style=\\"font-size: 20px;\\"><b>\\"No Segregation, No Collection\\"<\\/b><\\/font><\\/h1><div><br><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\">The Barangay Garbage Collectors will no longer collect garbage or waste which are not properly segregated. This is to minimize the cost and make use of land fill properly<\\/span><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\"><br><\\/span><\\/div><h2><span style=\\"font-size: 16px; line-height: 25.3968px;\\"><b>Waste Categories<\\/b><\\/span><\\/h2><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\">The Barangay has categorize the waste to be segregated by three. These are the following<\\/span><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\">1. <b><i>Kitchen Waste<\\/i><\\/b> - This are the waste that are typically found in the kitchen. These are mostly food wastes. E.g. Banana Pill, Bones<\\/span><\\/div><div><br><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\">2. <i><b>Biodegradable<\\/b>&nbsp;- <\\/i>Waste that can easily decompose. E.g. Papers, leaves<\\/span><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\"><i><br><\\/i><\\/span><\\/div><div><span style=\\"font-size: 16px; line-height: 25.3968px;\\"><i>3 <b>Non-Biodegradable<\\/b> - <\\/i>Waste that usually takes a very long time to decompose. E.g. Bottle, Plastic Cup<\\/span><\\/div><div><font style=\\"font-size: 16px;\\"><br><\\/font><\\/div><div><font style=\\"font-size: 16px;\\"><br><\\/font><\\/div>"}}', 1456283740),
