INSERT INTO `information` (`ID`, `description`, `barangay_ID`, `source`, `type_ID`, `detail`, `datetime`) VALUES
(1, 'Garbage Day is... Payday? Why Your Trash is Worth ', 1, 'Kelly Gurnett', 1, '<img src="" alt="" style="max-width: 600px; max-height: 200px;">                                             <img src="http://cdn7.thepennyhoarder.com/wp-content/uploads/2014/08/5575089139_ffec7b5846_z.jpg" alt="" width="100%" height="auto">                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">                                                 <br>                                             </p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">Do you know how much garbage you produce each week?</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">Better question: Are you prepared to see it firsthand, getting up close and personal by lying amid a week’s worth of your trash?</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">Amazingly, some people were, and photographer Gregg Segal captured the results in his startling series&nbsp;<a title="7 Days of Garbage" href="http://fence.photovillenyc.org/f-2014/atlanta/home/gregg-segal/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">“7 Days of Garbage.”</a>&nbsp;You can take a look at what a typical week of trash looks like for different households in&nbsp;<a title="Mesmerizing Photos of People Lying in a Week’s Worth of Their Trash " href="http://www.slate.com/blogs/behold/2014/07/08/gregg_segal_photographs_people_with_a_week_s_worth_of_their_trash_in_his.html" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">this recent article on Slate</a>.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">We see two morals in this pungent story:</p>                                             <div style="margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);">                                                 <center style="margin: 0px; padding: 0px; max-height: 1e+06px;">                                                     <div id="googmob" style="margin: 0px; padding: 0px; max-height: 1e+06px;"></div>                                                 </center>                                             </div>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">1. Americans produce a scary amount of trash.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">2. Some of that trash could be put to better use making them cold, hard cash.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">We took a closer look at these unpleasant but powerful photos to identify some ways these people could be turning their trash into cash — and you could be, too.</p>                                             <h3 style="margin: 28px 0px 14px; max-height: 1e+06px; font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); font-size: 1.15em; padding: 0px !important; background-color: rgb(255, 255, 255) !important;">Recycling</h3>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Bottles and cans</b></p>                                             <div style="margin: 10px 0px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; float: none; text-align: center; background-color: rgb(255, 255, 255);">                                                 <center style="margin: 0px; padding: 0px; max-height: 1e+06px;">                                                     <div id="placement_197470_0" style="margin: 0px; padding: 0px; max-height: 1e+06px;"></div>                                                 </center>                                             </div>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Depending on your state’s return laws, you can save them up and<a title="How I Made $1,500 Collecting Soda Cans at Work" href="http://www.thepennyhoarder.com/collecting-cans/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">return them</a>&nbsp;to your local grocery store or recycling center for profit.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Wine bottles and corks</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>They’re actually hot material for DIY projects, and arts and crafters will pay for them on eBay. Just wash them off,&nbsp;<a title="Make Money Recycling Wine Corks" href="http://www.thepennyhoarder.com/make-money-recycling-wine-corks/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">list them</a>&nbsp;and profit!</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Metal bits and pieces</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>You don’t have to have a big item like a beat-up car to cash in on<a title="Scrap Your Way to Hundreds" href="http://www.thepennyhoarder.com/scrap-your-way-to-hundreds/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">selling scrap metal</a>. Everything from old door locks to copper wiring can fetch a decent price if you collect enough of it.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: All other miscellaneous recyclable material</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use #1:&nbsp;</b>Get paid for having your city haul it away!&nbsp;<a title="Recyclebank" href="https://www.recyclebank.com/curbside/details" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">Recyclebank</a>works with waste haulers in many communities to track how much recycling they collect from your curb. You earn points for each haul, which can be converted into rewards like magazine subscriptions and shopping discounts. (<a href="http://ctt.ec/9ho1z" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">Like this idea? Click to tweet it</a>!)</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use #2:</b>&nbsp;If you prefer to give back,&nbsp;<a title="Terracycle" href="http://www.terracycle.com/en-US/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">Terracycle</a>&nbsp;will send you a prepaid box to mail your trash in to them. Every box you send in earns you points that can be redeemed for charitable gifts or donations to the nonprofit or school of your choice.</p>                                             <h3 style="margin: 28px 0px 14px; max-height: 1e+06px; font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); font-size: 1.15em; padding: 0px !important; background-color: rgb(255, 255, 255) !important;">Reusing</h3>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Unused fruit</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use&nbsp;</b>Not sure you’ll be able to eat all that fruit before it goes bad? Make it into jam or preserves and sell them at your local&nbsp;<a title="Dream of Selling Jam or Produce at a Farmers Market? Here’s Your Guide" href="http://www.thepennyhoarder.com/dream-selling-jam-produce-farmers-market-heres-guide/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">farmers market</a>.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Soggy coffee grounds</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Used coffee grounds actually make great compost, as two business students found out and leveraged into their&nbsp;<a title="Back to the Roots" href="https://www.backtotheroots.com/about-us" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">Back to the Roots</a>urban mushroom growing kits.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Food scraps</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Create a compost heap in your yard and use it to fertilize a kitchen garden to&nbsp;<a title="Choose the Best, Money-Saving Plants for Your Vegetable Garden" href="http://lifehacker.com/choose-the-best-money-saving-plants-for-your-vegetable-510676441" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">reduce your grocery bills</a>.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Random fabric scraps and other odds and ends that can’t be recycled</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Get crafty! You can make everything from purses to picture frames with a little artistic creativity and sell them on sites like Etsy.&nbsp;<a title="She Turns Trash Into Cash" href="http://www.more.com/reinvention-money/second-acts/she-turns-trash-into-cash" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">This woman in Turkey</a>&nbsp;built a whole business out of turning used packaging like candy wrappers and canned-food labels into clutches and handbags.</p>                                             <h3 style="margin: 28px 0px 14px; max-height: 1e+06px; font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); font-size: 1.15em; padding: 0px !important; background-color: rgb(255, 255, 255) !important;">Selling</h3>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Food packaging</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Cut out those&nbsp;<a title="Boxtops For Education" href="http://www.thepennyhoarder.com/blog-posting-7/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">Boxtops for Education</a>&nbsp;and sell them on eBay — you may not have any use for them, but other people will pay for them.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Old baby toys/household items/etc.</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:</b>&nbsp;Just because you’re no longer using something, that doesn’t mean someone else won’t be able to get many more years out of it. Rather than trashing your gently used items, consider selling them at a&nbsp;<a title="A Fun and Low-Cost Business: Selling at Flea Markets" href="http://www.thepennyhoarder.com/selling-at-flea-markets/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">flea market</a>, garage sale or on Craigslist to put some extra cash in your pocket (and keep one more item out of a landfill).</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Defunct phones</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Upgraded to something cooler? Don’t junk your old device;&nbsp;<a title="How to Sell Your Old Phone for the Most Amount of Cash" href="http://www.thepennyhoarder.com/how-to-sell-your-old-phone-for-the-most-amount-of-cash/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">you can sell it</a>&nbsp;for profit.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Item: Used stuffed animals</b></p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Better use:&nbsp;</b>Give them a clean-up and&nbsp;<a title="How to Sell Used Stuffed Animals for Extra Cash" href="http://www.thepennyhoarder.com/how-to-sell-used-stuffed-animals-for-extra-cash/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">sell them on eBay</a>. Collectors, gift-givers and people looking to recapture their childhood are all willing to pay to take them off your hands.</p>                                             <h3 style="margin: 28px 0px 14px; max-height: 1e+06px; font-family: Roboto, Arial, Helvetica, sans-serif; font-weight: bold; color: rgb(70, 70, 70); font-size: 1.15em; padding: 0px !important; background-color: rgb(255, 255, 255) !important;">For Bonus Points</h3>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">Once you’ve learned how to max out the profit with your own trash, why not take it up a notch and starting&nbsp;<a title="Why You Should See Dollar Signs When Your Neighbor Puts Junk On the Curb" href="http://www.thepennyhoarder.com/i-found-50-in-the-garbage/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">selling other people’s junk</a>? Dumpster-diving and curbside-trolling aren’t just for recent grads hoping to score a futon; they can also become a nice side business if you’re willing to put in a little work. You can also snag&nbsp;<a title="How to Make Money Reselling Craigslist Freebies" href="http://www.thepennyhoarder.com/how-to-make-money-reselling-craigslist-freebies/" target="_blank" style="margin: 0px; padding: 0px; max-height: 1e+06px; color: rgb(168, 100, 168); text-decoration: underline; outline: 0px; font-weight: bold; font-size: 22px;">free items on Craigslist</a>&nbsp;and resell them for a profit.</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);">Look at you, saving the planet and making money at the same time!</p>                                             <p style="margin-bottom: 28px; padding: 0px; max-height: 1e+06px; color: rgb(70, 70, 70); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 20px; line-height: 28px; background-color: rgb(255, 255, 255);"><b style="margin: 0px; padding: 0px; max-height: 1e+06px;">Your Turn: These are just a few ideas for making money from commonly thrown-away items. What other ways can you think of to turn your trash into cash?</b></p>', 1456270630),
(2, 'Waste Collection Policy', 1, 'Barangay Banilad', 2, '<h1 style="text-align: center;"><font style="font-size: 20px;"><b>"No Segregation, No Collection"</b></font></h1><div><br></div><div><span style="font-size: 16px; line-height: 25.3968px;">The Barangay Garbage Collectors will no longer collect garbage or waste which are not properly segregated. This is to minimize the cost and make use of land fill properly</span></div><div><span style="font-size: 16px; line-height: 25.3968px;"><br></span></div><h2><span style="font-size: 16px; line-height: 25.3968px;"><b>Waste Categories</b></span></h2><div><span style="font-size: 16px; line-height: 25.3968px;">The Barangay has categorize the waste to be segregated by three. These are the following</span></div><div><span style="font-size: 16px; line-height: 25.3968px;">1. <b><i>Kitchen Waste</i></b> - This are the waste that are typically found in the kitchen. These are mostly food wastes. E.g. Banana Pill, Bones</span></div><div><br></div><div><span style="font-size: 16px; line-height: 25.3968px;">2. <i><b>Biodegradable</b>&nbsp;- </i>Waste that can easily decompose. E.g. Papers, leaves</span></div><div><span style="font-size: 16px; line-height: 25.3968px;"><i><br></i></span></div><div><span style="font-size: 16px; line-height: 25.3968px;"><i>3 <b>Non-Biodegradable</b> - </i>Waste that usually takes a very long time to decompose. E.g. Bottle, Plastic Cup</span></div><div><font style="font-size: 16px;"><br></font></div><div><font style="font-size: 16px;"><br></font></div>', 1456271377),
(3, 'Waste Collection Schedule', 1, 'Barangay Banilad', 2, '<h1 style="text-align: center;">Garbage Collection Schedule<br></h1><div style="text-align: center;">The following are the day and time of collection of garbage in your area</div><div><br></div><div style="text-align: center;"><b>Monday</b>&nbsp;</div><div style="text-align: center;">&nbsp; &nbsp; &nbsp; 7:30 am - 10:00 am</div><div style="text-align: center;"><br></div><div style="text-align: center;"><b style="line-height: 22.2222px;">Tuesday</b></div><div style="text-align: center;"><span style="line-height: 22.2222px;">&nbsp; &nbsp; &nbsp;8:30 am - 11:00 am</span></div><div style="text-align: center;"><span style="line-height: 22.2222px;"><b><br></b></span></div><div style="text-align: center;"><span style="line-height: 22.2222px;"><b>Friday</b>&nbsp;</span></div><div style="text-align: center;"><span style="line-height: 22.2222px;">&nbsp; &nbsp; &nbsp;8:30 am - 11:00 am</span><span style="line-height: 22.2222px;"><br></span></div><div style="text-align: center;"><br></div>', 1456272183);
INSERT INTO `information` (`ID`, `description`, `barangay_ID`, `source`, `type_ID`, `detail`, `datetime`) VALUES
(4, 'Talisay allows Cebu City to use its sanitary landf', 1, 'Kristine B. Quintas', 1, '<div style="text-align: center;"><img src="data:image/jpeg;base64," alt="" title="Liloan-Phillipines-2531-2-1024x682.jpg" width="300" height="200" style="line-height: 1.42857;"><img src="data:image/jpeg;base64," alt="" title="Landfill_compactor.jpg" width="300" height="200" style="font-size: 16px; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;"></div><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">CEBU, Philippines - Talisay City has allowed Cebu City to temporarily dump garbage in Barangay Tapul after the permanent closure of the Inayawan sanitary landfill.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">The Talisay City-operated sanitary landfill, which has been operational since 2005 and has an area of more than two hectares, is adjacent to the Mananga Watershed.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">The facility accepts waste from Talisay City and the nearby municipality of Minglanilla.</p><p style="text-align: center; margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Cebu City Solid Waste Management Board Chairman Jade Ponce said Talisay Mayor Johnny De los Reyes and Mayor Michael Rama already made an initial agreement prior to the closure of the Inayawan sanitary landfill last January 15.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">“In principle, they (De los Reyes and Rama) agreed that… (Cebu) City will be allowed to dispose certain tons (of garbage) in their landfill,” Ponce said.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">He said the agreement would be an advantage to Talisay since it would generate revenue from the tipping fee Cebu City would be paying for its garbage.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">“The good thing is we are helping our fellow local government unit kay maka-additional income man sila nato by helping us in solving our garbage woes,” Ponce said.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Cebu City closed the 15-hectare Inayawan facility, which had been in operation for the past 15 years, because it has reached its lifespan and continued use already pose hazard to public health and the environment.&nbsp;</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Ponce said they are still negotiating with Talisay as to the amount for the tipping fees and the allowable volume of garbage from Cebu City to be disposed in Tapul.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">He said they will lobby for at least 50 tons of garbage a day, to be increased in the later months to 100 tons.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Closure of the Inayawan landfill has affected garbage disposal especially in Cebu City’s south district barangays.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Ponce said they are looking for solutions to address the concerns of the barangays, considering also the distance to and from the city’s accredited landfill in in Pulpogan, Consolacion town.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">He said the city would be renting five 10-wheeler trucks to help the barangays in their daily collection of garbage for one month while unserviceable barangay dump trucks are still being repaired.</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">Ponce pointed out that it is the obligation of the barangays to collect garbage while the city is only tasked to collect residual wastes, as provided for under Republic Act 9003 (Solid Waste Management Act).</p><p style="margin-bottom: 1.2em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">“We are giving them 30 days to prepare and upgrade their garbage trucks para dili ra sila magsalig sa city. All these things are temporary until we find the final solution,” he said. —/<strong>RHM (FREEMAN)</strong></p><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; line-height: 21px;">- See more at: http://www.philstar.com/cebu-news/2015/01/23/1415865/talisay-allows-cebu-city-use-its-sanitary-landfill#sthash.q14OnOHP.dpuf</span><br>', 1456273256);
